import React from "react";

function Contact() {
  return (
    <div id="info">
      <p>Address:</p>
      <p>3528 Gentian Blvd</p>
      <p>Columbus, Georgia.</p>
      <p>Phone Number:</p>
      <p>(678) 668-3880</p>
      <p>realdipe@gmail.com</p>
    </div>
  );
}

export default Contact;
